nodes = {}
neighbours = [(0,1), (0,-1), (1,0), (-1,0)]

for point in maze:
    if maze[point] == 1:
        continue

    nodes[point] = []
    x, y = point

    for neighbour in neighbours:
        n_dx, n_dy = neighbour
        neighbour_point = (x+n_dx, y+n_dy)

        if neighbour_point in maze and maze[neighbour_point] != 1:
            nodes[point].append(neighbour_point)

end_node = (16,-18)
start_node = end_node # (0, 0)

visited =  {node: False for node in nodes}
queue = []
shortest_distance = {node: float('inf') for node in nodes}

queue.append(start_node)
visited[start_node] = True
shortest_distance[start_node] = 0

while queue:
    current_node = queue.pop(0)
    distance_of_current = shortest_distance[current_node]

    for neighbour in nodes[current_node]:
        if not visited[neighbour]:
            queue.append(neighbour)
            visited[neighbour] = True

        distance_of_neighbour = shortest_distance[neighbour]

        if distance_of_neighbour > distance_of_current + 1:
            shortest_distance[neighbour] = distance_of_current + 1

print(max(shortest_distance.values()))